pragma solidity ^0.6.0;

import "@openzeppelin/contracts/math/SafeMath.sol";
import "@openzeppelin/contracts/utils/Create2.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "./RebaseableToken.sol";
import "./interfaces/IPriceOracleGetter.sol";
import './interfaces/IMinimalUniswap.sol';

// import "@nomiclabs/buidler/console.sol";

contract OptionsPool {
    uint8 constant version  = 0;
    using SafeMath for uint256;

    struct Settlement {
        uint256 ups;
        uint256 downs;
        uint256 epoch;
    }

    mapping(address => Settlement) private settlements;

    /**
        The mapping of the epoch to the ending price;
        This is used to calculate the liquidity rewards;
     */
    mapping(uint256 => uint256) public epochToPrice;

    RebaseableToken public up;
    RebaseableToken public down;

    address private owner;

    IPriceOracleGetter public oracle;

    /**
        This is the price returned by the oracle at the
        beginning of thise epoch.
     */
    uint256 public epochStartPrice;

    /**
        This is the blockNumber of the start of this epoch
     */
    uint256 public epochStart;
    /**
        The current epoch
     */
    uint256 public epoch = 0;
    /**
        How many blocks should this epoch last?
     */
    uint256 public epochLength;

    IERC20 public underlying;

    /**
        The token which ups and downs convert into
     */
    IERC20 public payoutToken;

    IMinimalUniswapV2Factory public uniswapFactory;
    IMinimalUniswapV2Pair public uniswapPair;

    uint8 public multiplier;

    // uint256 public rake = 0; // the amount this pool charges for in percentage as 18 decimal precision integer

    modifier isOwner {
        require(msg.sender == owner, "UpDown:Only owner");
        _;
    }

    modifier checkEpoch {
        if (block.number >= epochStart.add(epochLength)) {
            endEpoch();
        }
        _;
    }

    modifier requireNoSettlement {
        require(
            settlements[msg.sender].epoch == 0,
            "UpDown:has settlement"
        );
        _;
    }

    constructor() public {
        owner = msg.sender;
    }

    function testForEnd() public checkEpoch {}

    function createUpAndDown()
        internal
        returns (address upAddr, address downAddr)
    {
        bytes memory bytecode = type(RebaseableToken).creationCode;
        bytes32 upSalt = keccak256(
            abi.encodePacked(address(this), int8(0))
        );
        // console.logBytes32(upSalt);
        bytes32 downSalt = keccak256(
            abi.encodePacked(address(this), int8(1))
        );
        upAddr = Create2.deploy(0, upSalt, bytecode);
        downAddr = Create2.deploy(0, downSalt, bytecode);

        RebaseableToken(upAddr).initialize(
            "UpDownUp", 
            "udUp", 
            address(this));
        RebaseableToken(downAddr).initialize(
            "UpDownDown",
            "udDn",
            address(this)
        );
        setTokens(upAddr, downAddr);

        return (upAddr, downAddr);
    }

    // following the pattern of uniswap so there can be a pool factory
    function initialize(
        address owner_,
        address payoutToken_,
        uint256 epochLength_,
        uint8 multiplier_,
        address oracle_,
        address factory_,
        address underlying_
    ) public isOwner {
        owner = owner_;
        payoutToken = IERC20(payoutToken_);
        oracle = IPriceOracleGetter(oracle_);
        uniswapFactory = IMinimalUniswapV2Factory(factory_);
        epochStart = block.number;
        epochLength = epochLength_;
        multiplier = multiplier_;
        underlying = IERC20(underlying_);
        epochStartPrice = oracle.getAssetPrice(underlying_);
        createUpAndDown();
    }

    function setTokens(address up_, address down_) internal isOwner {
        up = RebaseableToken(up_);
        down = RebaseableToken(down_);
    }

    function setOwner(address newOwner) public isOwner {
        owner = newOwner;
    }

    function mySettlement()
        public
        view
        returns (
            uint256 ups,
            uint256 downs,
            uint256 epochNumber
        )
    {
        Settlement storage settlement = settlements[msg.sender];
        // if we're at the zero epoch use that
        // else if the settlement epoch is > 0 but the epoch we settled at has not yet passed
        // use the one before the settlement
        uint256 pricingEpoch = 0;
        if (epoch > settlement.epoch) {
            pricingEpoch = settlement.epoch;
        } else if (settlement.epoch > 0) {
            pricingEpoch = settlement.epoch - 1;
        }
        uint256 upGonsPerFrag = up.epochGonsPerFragment(pricingEpoch);
        uint256 downGonsPerFrag = down.epochGonsPerFragment(pricingEpoch);
        return (
            settlement.ups.div(upGonsPerFrag),
            settlement.downs.div(downGonsPerFrag),
            settlement.epoch
        );
    }

    /**
        calculate the percent change defined as an 18 precision decimal (1e18 is 100%)
     */
    function percentChangeMax100(uint256 diff, uint256 base)
        internal
        view
        returns (uint256)
    {
        uint256 percent = (diff * 10**18).mul(10**18).div(base.mul(10**18)).mul(uint256(multiplier));
        if (percent >= 10**18) {
            percent = uint256(10**18).sub(1);
        }
        return percent;
    }

    function endEpoch() internal {
        updatePrice(oracle.getAssetPrice(address(underlying)));
    }

    function updatePrice(uint256 newPrice_) internal {
        uint256 currentPrice = epochStartPrice;
        uint256 upTotal = up.totalSupply();
        uint256 downTotal = down.totalSupply();

        bool upIsBigger = upTotal >= downTotal;

        if (newPrice_ > currentPrice) {
            uint256 diff = newPrice_.sub(currentPrice);
            uint256 percent = percentChangeMax100(diff, currentPrice);

            // console.log("percent greater: ", percent);

            if (upIsBigger) {
                // if up is bigger than we want to start by deflating down
                // and then adding to ups
                uint256 newTokens = downTotal.mul(percent).div(10**18);
                uint256 newSupply = down.rebase(epoch, int256(newTokens) * -1);

                // console.log(
                //     "tokens removed from down: ",
                //     downTotal.sub(newSupply)
                // );

                uint256 toAdd = downTotal.sub(newSupply);

                up.rebase(epoch, int256(toAdd));
            } else {
                // the down supply is bigger so increase the ups and then decrease the downs
                uint256 newTokens = upTotal.mul(percent).div(10**18);
                uint256 newSupply = up.rebase(epoch, int256(newTokens));

                uint256 toRemove = newSupply.sub(upTotal);
                down.rebase(epoch, int256(toRemove) * -1);
            }
        } else if (newPrice_ < currentPrice) {
            uint256 diff = currentPrice.sub(newPrice_);
            uint256 percent = percentChangeMax100(diff, currentPrice);
            if (upIsBigger) {
                // if up is bigger than we want to start by inflating down
                // and then adding to ups
                uint256 newTokens = downTotal.mul(percent).div(10**18);
                uint256 newSupply = down.rebase(epoch, int256(newTokens));

                // console.log("tokens added to down: ", newSupply.sub(downTotal));

                uint256 toAdd = newSupply.sub(downTotal);

                up.rebase(epoch, int256(toAdd) * -1);
            } else {
                // the down supply is bigger so decrease the ups and then increase the downs
                uint256 newTokens = upTotal.mul(percent).div(10**18);
                uint256 newSupply = up.rebase(epoch, int256(newTokens) * -1);

                uint256 toRemove = upTotal.sub(newSupply);
                down.rebase(epoch, int256(toRemove));
            }
        } else {
            up.rebase(epoch, 0);
            down.rebase(epoch, 0);
        }
        updateUniswap();
        epochStartPrice = newPrice_;
        epoch++;
        epochStart = block.number;
        // otherwise the prices are the same and we can just ignore
    }

    function updateUniswap() internal {
        if (address(uniswapFactory) != address(0)) {
            if (address(uniswapPair) == address(0)) {
                uniswapPair = IMinimalUniswapV2Pair(uniswapFactory.getPair(address(up), address(down)));
            }
            if (address(uniswapPair) != address(0)) {
                uniswapPair.sync();
            }
        }
    }

    /**
        The user wants out of the pool and so at the end of this epoch we will
        let them cash out.
     */
    function settle() public requireNoSettlement checkEpoch {
        settlements[msg.sender].epoch = epoch;
        settlements[msg.sender].ups = up.liquidate(msg.sender);
        settlements[msg.sender].downs = down.liquidate(msg.sender);
        // this effectively locks their account until they call liquidate
    }

    // TODO: this provides an arbitrage opportunity to withdraw
    // before the end of a period. This should be a lockup.
    function liquidate() public checkEpoch {
        Settlement storage settlement = settlements[msg.sender];
